import './Intro.css';
import pfp from'../extra/pfp.jpeg'

function Intro() {
  return (
    <div className="Intro">

          <h1 id="name">Camille Gandotra</h1>
          <button id="pfp"><img src={pfp} alt="Profile" /></button>
    </div>
  );
}

export default Intro;
